import React from 'react';

const Alert = ({ variant, children }) => {
  const variantClass = variant === 'destructive' ? 'bg-red-100 text-red-700' : 'bg-green-100 text-green-700';
  return (
    <div className={`p-4 rounded ${variantClass}`}>
      {children}
    </div>
  );
};

export default Alert;
